import { useState } from 'react'
import Expenseitem from "./Expenseitems.js"
import Expensefilter from "./expense-filter"
import "./expenses.css"
const Expenses = (props) => {
    const [filteredyear, setFilteredyear] = useState('2020');
   const changefilteryear = (year) => {
       setFilteredyear(year);
   }
   const filteredexpenses = props.item.filter((expense)=>{
    return expense.date.getFullYear().toString() === filteredyear;
   });
   let expensescontent = <p>No content found.</p>;
   if(filteredexpenses.length >0){
       expensescontent=filteredexpenses.map(expense => <Expenseitem key = {expense.id} title={expense
        .title} amount={expense.amount} date={expense.date}/>);
   }
    return (
    
    <div className="expenses"> 
     <Expensefilter selected={filteredyear} onChangeFilter={changefilteryear}/>
     {expensescontent}
    
  </div>);
};
export default Expenses;
